import axios from 'axios';
import React, { useEffect, useState } from 'react';
import styled from 'styled-components';

// Styled Components
const Container = styled.div`
  padding: 20px;
  max-width: 1200px;
  margin: 0 auto;
`;

const Title = styled.h1`
  text-align: center;
  margin-bottom: 30px;
  font-family: 'Arial', sans-serif;
  color: #4b0082;
`;

const OrderCard = styled.div`
  background: #f9f9f9;
  border-radius: 8px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  padding: 20px;
  margin-bottom: 20px;
  font-family: 'Arial', sans-serif;
`;

const UserInfo = styled.div`
  margin-bottom: 15px;
  font-size: 16px;
  color: #333;

  h2 {
    font-size: 18px;
    color: #2a2a2a;
  }

  p {
    margin: 5px 0;
  }
`;

const Address = styled.p`
  color: #777;
  font-size: 14px;
`;

const DateTime = styled.p`
  font-size: 14px;
  color: #555;
`;

const ProductList = styled.ul`
  list-style-type: none;
  padding: 0;
`;

const ProductItem = styled.li`
  background: #f1f1f1;
  padding: 10px;
  margin: 8px 0;
  border-radius: 6px;
  font-size: 14px;
  display: flex;
  justify-content: space-between;
`;

const ProductName = styled.span`
  font-weight: bold;
`;

const ProductDetails = styled.span`
  font-size: 14px;
  color: #444;
`;

const Status = styled.p`
  font-weight: bold;
  font-size: 16px;
  color: #007bff;
`;

const NoOrders = styled.p`
  font-size: 18px;
  color: #555;
  text-align: center;
`;

const Orders = () => {
    const [orders, setOrders] = useState([]);

    useEffect(() => {
        const fetchOrders = async () => {
            try {
                const response = await axios.get('http://localhost:8080/api/get-orders', { withCredentials: true });
                if (response.status === 200) {
                    setOrders(response.data);
                }
            } catch (error) {
                console.log(error);
            }
        };
        fetchOrders();
    }, []);

    return (
        <Container>
            <Title>Orders</Title>
            {orders.length > 0 ? (
                orders.map((order, index) => (
                    <OrderCard key={index}>
                        <UserInfo>
                            <h2>User: {order.user.firstName} {order.user.lastName}</h2>
                            <p><strong>Phone Number:</strong> {order.user.phoneNumber}</p>
                            <Status>Status: {order.status}</Status>
                        </UserInfo>
                        <Address>
                            <strong>Address:</strong> {order.address.area}, {order.address.neighbourhood}, {order.address.street}, {order.address.alleys}, {order.address.postalCode}, {order.address.plaque}
                        </Address>
                        <DateTime>
                            <strong>Date and Time:</strong> {new Date(order.dateAndTime.date).toLocaleDateString()} at {order.dateAndTime.time}
                        </DateTime>

                        <h3>Ordered Products:</h3>
                        <ProductList>
                            {order.orderedProducts.map((product, idx) => (
                                <ProductItem key={idx}>
                                    <ProductName>{product.productName}</ProductName>
                                    <ProductDetails>
                                        Price: {product.productPrice} | Quantity: {product.quantity}
                                    </ProductDetails>
                                </ProductItem>
                            ))}
                        </ProductList>
                    </OrderCard>
                ))
            ) : (
                <NoOrders>No orders found.</NoOrders>
            )}
        </Container>
    );
};

export default Orders;
